import React from "react";
import { Box, Snackbar } from "@mui/material";
import CloseIcon from "@mui/icons-material/Close";
import LinearProgress from "@mui/material/LinearProgress";
import UploadIcon from "../../../../public/assets/uploadIcon.svg";
import SnackbarContent, {} from "@mui/material/SnackbarContent";
import Icon from "../../Atoms/Icon/Icon";
import { makeStyles } from '@material-ui/core'
import TypographyComponent from "../../Atoms/Typography/TypographyComponent";


export type ImageUploadProgressProp = {
  progress: number;
  imageName: string;
  onClose?: any;
};




const UploadDialogueBox: React.FC<ImageUploadProgressProp> = (props) => {
  const useStyles = makeStyles((theme) => ({
    icon: {
      paddingLeft: "13px",

      paddingBottom: "31px",  },
      imageNameStyle:{
        fontWeight: 400,
        fontSize: "14px",
        lineHeight: "22px",
        color: '#FFFFFF',
        fontFamily: "Roboto",
    }
  }))
  const classes = useStyles()

  return (
    <>
      <SnackbarContent  style={{
        width:''
      }}
        action={
          <Box>
            <CloseIcon
              onClick={props.onClose}
              sx={{ paddingBottom: "5px", paddingRight: "5px" }}
            />
          </Box>
        }
        message={
          <Box
            sx={{
              display: "flex",
              alignItems: "center",
              justifyContent: "center",
            }}
          >
            <Icon
              imageSrc={UploadIcon}
              classname={classes.icon}
            />
            <Box sx={{ paddingBottom: "16px", paddingLeft: "10px" }}>
              <Box
                sx={{
                  justifyContent: "space-between",
                  display: "flex",
                }}
              >
                <TypographyComponent text={props.imageName} classname={classes.imageNameStyle}></TypographyComponent>{" "}
                <TypographyComponent text='Uploading' classname={classes.imageNameStyle}></TypographyComponent>
              </Box>

              <LinearProgress
                variant="determinate"
                value={props.progress}
                sx={{ width: "290px", height: "6px", borderRadius: "4px" }}
              />
            </Box>
          </Box>
        }
      ></SnackbarContent>
    </>
  );
};

export default UploadDialogueBox;
